import React from "react";

function Post() {
  return (
    <div>
      <main>
        <div className="head">
            <p></p>
            <h6><i className="fas fa-user-circle fa-2x"></i> Pranshu Singh</h6>
        </div>
        <div className="body"></div>
        <div className="foot"></div>
      </main>
    </div>
  );
}

export default Post;
